import { Router } from '@reach/router';
import './App.css';
import Home from './views/Home';
import Add from './views/Add';
import One from './views/One';
import Update from './views/Update';

function App() {
  return (
    <div className="App">
      <h1> Pet Shelter </h1>
      <Router>
        <Home path="/" />
        <Add path="/pets/new" />
        <One path="/pets/:id" />
        <Update path="/pets/update/:_id" />
      </Router>
    </div>
  );
}

export default App;
